/**
 * Obtiene el SVG de un icono por su nombre
 * @param name - Nombre del icono
 * @param size - Tamaño opcional (por defecto hereda del SVG: 24)
 * @returns String HTML del SVG o string vacío si no existe
 */
function getIcon(name, size) {
    const svg = exports.icons[name];
    if (!svg) {
        console.warn(`[icons] Icono "${name}" no encontrado`);
        return '';
    }
    if (size) {
        return svg.replace(/width="24"/, `width="${size}"`).replace(/height="24"/, `height="${size}"`);
    }
    return svg;
}
/**
 * Crea un span con el icono inline
 * @param name - Nombre del icono
 * @param className - Clases CSS adicionales opcionales
 * @param size - Tamaño opcional
 * @returns String HTML del span con el SVG dentro
 */
function iconSpan(name, className = '', size) {
    const svg = getIcon(name, size);
    return `<span class="icon ${className}">${svg}</span>`;
}
// Exponer globalmente para uso en HTML onclick, etc.
window.getIcon = getIcon;
window.iconSpan = iconSpan;
window.icons = exports.icons;
